import styled from 'styled-components/native';

export const Container = styled.View`
  flex: 1;
  background-color: #d1d1d1;
  align-items: center;
  justify-content: center;
`;

export const Text = styled.Text`
  font-family: Montserrat, sans-serif;
  font-size: 16px;
  color: #000;
`;
